// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DrugTraceability {
    struct Drug {
        string name;
        string manufacturer;
        string batchNumber;
        address owner;
        string state;
        string districtCode;
        string postOfficeNumber;
        uint256 registrationDate;
    }

    mapping(uint256 => Drug) public drugs;
    mapping(string => bool) public batchNumberExists; // Track unique batch numbers
    uint256 public drugCount;
    uint256[] public registeredDrugIds; // keep track of registered IDs

    // Register a drug with batch number validation
    function registerDrug(
        uint256 _id,
        string memory _name,
        string memory _manufacturer,
        string memory _batchNumber,
        string memory _state,
        string memory _districtCode,
        string memory _postOfficeNumber
    ) public {
        require(drugs[_id].owner == address(0), "Drug already registered");
        require(!batchNumberExists[_batchNumber], "Batch number already exists");
        
        drugs[_id] = Drug(
            _name, 
            _manufacturer, 
            _batchNumber, 
            msg.sender,
            _state,
            _districtCode,
            _postOfficeNumber,
            block.timestamp
        );
        
        batchNumberExists[_batchNumber] = true;
        registeredDrugIds.push(_id);
        drugCount++;
    }

    // Get drug details by ID
    function getDrugDetails(uint256 _id) public view returns (
        string memory, string memory, string memory, address, string memory, string memory, string memory, uint256
    ) {
        require(drugs[_id].owner != address(0), "Drug not found");
        Drug memory drug = drugs[_id];
        return (drug.name, drug.manufacturer, drug.batchNumber, drug.owner, drug.state, drug.districtCode, drug.postOfficeNumber, drug.registrationDate);
    }

    // Get all registered drug IDs
    function getAllRegisteredDrugs() public view returns (uint256[] memory) {
        return registeredDrugIds;
    }
    
    // Check if batch number exists
    function isBatchNumberExists(string memory _batchNumber) public view returns (bool) {
        return batchNumberExists[_batchNumber];
    }
    
    // Transfer drug ownership
    function transferOwnership(uint256 _id, address _newOwner) public {
        require(drugs[_id].owner != address(0), "Drug not found");
        require(drugs[_id].owner == msg.sender, "You are not the owner");
        drugs[_id].owner = _newOwner;
    }
}

